import React, { Component } from 'react';
import logo from './logo.png';
import './App.css';
import {Router, Route, Link, RouteHandler} from 'react-router-dom';
import {firebaseApp} from "./firebase";
import { Button,ButtonToolbar,View} from 'react-bootstrap';
class App extends Component {

	constructor(props) {
        super(props);
	this.count = 0;
        this.state = {
            name: '',
            sigid: '', 
            major: '', 
            units: '',
	showComponent:false,
        };

        this.handleChange = this.handleChange.bind(this);
        this.handleSubmit = this.handleSubmit.bind(this);
    }  
    signOutUser(){
      this.props.history.push('/login');
      firebaseApp.auth().signOut().then(function() {
          console.log('Signed Out');
        }, function(error) {
          console.error('Sign Out Error', error);
        });
      }
  render() {
    return (

      <div className="App">
	    <View style={styles.container}>
<ButtonToolbar>
  <Button variant="primary">Primary</Button>
  <Button variant="secondary">Secondary</Button>
  <Button variant="success">Success</Button>
  <Button variant="warning">Warning</Button>
  <Button variant="danger">Danger</Button>
  <Button variant="info">Info</Button>
  <Button variant="light">Light</Button>
  <Button variant="dark">Dark</Button>
  <Button variant="link">Link</Button>
</ButtonToolbar>
	    </View>

	  <Button variant="outline-secondary" color="primary" class="float-right" onClick={() => this.signOutUser()}> Logout</Button>
        <header className="App-header">

          <h1 style={{'fontSize': '50px', 'vertical-align' : 'top'}}>
          	Home
	  </h1>
          <img src={logo} alt="Logo" />
            </header>
                 </div>
    );
  }
  handleChange(event) {
   // console.log("doing stuff");
    console.log(event.target.value);
    this.setState({
        [event.target.name]:event.target.value
	});
  }

  handleSubmit(event) {
	this.count += 1;	
//	console.log("this is count" + this.count);
    alert('A name was submitted: ' + this.state.name);
    console.log(this.state.name + "where is this");
    event.preventDefault();
  }
}
export default App;
